import React from 'react'
import img2 from '../imges/notfound.jpg'
export default function Notfound() {
  return (
    <>
    <div className="container ">
      <div className="div m-5 vh-100">
        <img src={img2} className='w-100' />
      </div>
    </div>

    </>
  )
}
